import styled from "styled-components";
import React, { useState } from "react";
import Avartar1 from "../../dummyResources/Avartar1.png";
import MainPicDummy from "../../dummyResources/MainPicDummy.jpg";
import { Collapse } from "react-collapse";

interface Props {}

const Header = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
`;

const HeaderWrapper = styled.div`
  display: flex;
  width: 100%;
  padding: 10px;
  justify-content: space-between;
`;

const ContainerFeedPage = styled.div`
  width: 100%;
`;

const HeaderTitle = styled.p`
  font-size: 30px;
  font-weight: 800;
`;

const RequestP = styled.p`
  font-size: 16px;
  font-weight: 600;
  color: gray;
  padding-top: 8px;
`;

const Promo = styled.div`
  width: 100%;
  margin-top: 20px;
`;

const PromoPic = styled.img`
  width: 100%;
`;

const PromoText = styled.div`
  color: white;
  position: relative;
  top: -65px;
  left: 15px;
  width: 60%;
`;

const PromoTextHeading = styled.h3`
  padding-bottom: 11px;
  border-bottom: 1px solid white;
  font-size: 20px;
  font-weight: 800;
`;

const PromoTextDescription = styled.p`
  margin-top: 8px;
  font-size: 10px;
  font-weight: 500;
`;

const FeedContainer = styled.div`
  width: 90%;
  display: flex;
  justify-content: center;
  margin-bottom: 15px;
`;

const FeedImg = styled.img`
  width: 100px;
  height: 100px;
  border-radius: 15%;
  object-fit: cover;
`;

const FeedDescription = styled.div`
  width: 200px;
  padding-left: 10px;
  padding-top: 5px;
`;

const FeedHeading = styled.h4`
  color: #1c43b7;
  font-size: 15px;
  font-weight: 400;
`;

const FeedDetailP = styled.p`
  margin-top: 3px;
  font-size: 10px;
`;

const FeedTimeP = styled.p`
  margin-top: 3px;
  font-size: 10px;
  color: #8c94a4;
`;

const AvartarImg = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
  margin-right: -5px;
  border: 1px solid #8c94a4;
  object-fit: cover;
`;

const AvartarContainer = styled.div`
  display: flex;
`;

export default function FeedPage(props: Props) {
  const [tempBool, setTempBool] = useState<boolean>(false);
  return (
    <ContainerFeedPage>
      <Header>
        <HeaderWrapper>
          <button onClick={setTempBool(tempBool)}>
            <HeaderTitle>안암에서</HeaderTitle>
          </button>
          <Collapse isOpened={tempBool}>
            <p>hi</p>
            <p>hi</p>
            <p>hi</p>
            <p>hi</p>
